class FileManager:
    allowed_file_types = ['.csv', '.xlsx']

    def upload_file(self, file_name):
        if self.validate_file_format(file_name):
            return f"{file_name} uploaded successfully."
        else:
            return "Invalid file format."

    def validate_file_format(self, file_name):
        return any(file_name.endswith(ext) for ext in self.allowed_file_types)


